import React from "react"


class Save extends React.Component {
    render() {
        return(
            <div className="stateSave">
                Nome: {this.name},<br></br>
                Email: {this.email},<br></br>
                CPF: {this.cpf},<br></br>
                Endereço: {this.endereço},<br></br>
                Cidade: {this.cidade},<br></br>
                Estado: {this.estado},<br></br>
                Tipo: {this.tipo},<br></br>
                Resumo: {this.resumo},<br></br>
                Cargo: {this.cargo},<br></br>
                Descrição: {this.descrição},<br></br>
            </div>
        )
    }
}

export default Save;
